import React from 'react';
import s from './Header.module.css';

const Header = () => {
    return <header className={s.header}>
        <a href="http://kinohabrs.com/fentezi/1735-mstiteli-vse-chasti.html" target="_blank">
        <img
            src='https://i.playground.ru/p/Gz1qMTWoWlPxOQflLwe7XQ.jpeg' />
        </a>
    </header>
}


export default Header;
